onMusicID \nDeezer: https://RickAstley.lnk.to/DeezerID \n\nLyrics:\nWe’re no strangers to love\nYou know the rules and so do I\nA full commitment’s what I’m thinking of\nYou wouldn’t get this from any other guy\n\nI just wanna tell you how I’m feeling\nGotta make you understand\n\nNever gonna give you up\nNever gonna let you down\nNever gonna run around and desert you\nNever gonna make you cry\nNever gonna say goodbye\nNever gonna tell a lie and hurt you\n\nWe’ve known each other for so long\nYour heart’s been aching but you’re too shy to say it\nInside we both know what’s been going on\nWe know the game and we’re gonna play it\n\nAnd if you ask me how I’m feeling\nDon’t tell me you’re too blind to see\n\nNever gonna give you up\nNever gonna let you down\nNever gonna run around and desert you\nNever gonna make you cry\nNever gonna say goodbye\nNever gonna tell a lie and hurt you\n\n#RickAstley #NeverGonnaGiveYouUp #WheneverYouNeedSomebody #OfficialMusicVideo","commandRuns":[{"startIndex":180,"length":16,"onTap":{"innertubeCommand":{"clickTrackingParams":"CGoQ3NcEGCYiEwiHrqH3gJiJAxWMx5cIHTkzK_Q=","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/rickastleynever","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUTCg9yaWNrYXN0bGV5bmV2ZXIYAQ%3D%3D"}}},"loggingDirectives":{"trackingParams":"CGoQ3NcEGCYiEwiHrqH3gJiJAxWMx5cIHTkzK_Q=","enableDisplayloggerExperiment":true}},{"startIndex":197,"length":33,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBYQ040EGAYiEwiHrqH3gJiJAxWMx5cIHTkzK_RIxLuBrb2YjoZ1","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbmNmcWNFTF9hZmhuQk81NkRnU2hlNk1SMXpUUXxBQ3Jtc0trWjhUVHYyQVJOelkydHJHSDZaS3RSV25ub3Y3cjVfdWNxV2N2ZVRqVlJjVDhZTVN1eGI0Ym93RjVWN0lLQmtuSVlvSWVUN2t1bERQaU9PUGNYRmZUNmlGUXFWVy10M05OZl9lVUIwQXNiN0hmZVI0bw\u0026q=https%3A%2F%2Flinktr.ee%2Frickastleynever\u00
